  false,\n\t\"url\": null,\n\t\"notes\": \"The Airport Runways database (NTAD 2015)
  is a geographic dataset of runways in the United States and US territories containing
  information on the physical characteristics of the runways. The 6839 runways in
  the dataset are runways associated with the 19527 airports in the companion airport
  data set. This geospatial data is derived from the FAA's National Airspace System
  Resource Aeronautical Data Product (Effective April 2015).\",\n\t\"license_title\":
